import Config from '@public/config/settings'
import {mapGetters} from 'vuex'

export default {
  name: 'SidebarLogo',
  props: {
    collapse: {
      type: Boolean,
      required: true
    }
  },
  data() {
    return {
      title: Config.title,
      logo: Config.logo ? Config.logo : require('../../../../public/themes/' + this.getStyle()['style'] + '/images/logo.png')
    }
  },
  methods: {
    ...mapGetters(['getStyle'])
  }
}
